import React from 'react';
import images from "../Utilities/ImageDirectories/CampusWatchImages.json"
import Profile from './Profile';

function Page() {
  return (
    <div className="min-h-screen flex flex-col">
      <header className="bg-gray-200 py-4 px-8">
        <h1 className="text-3xl font-bold">OUTREACHES</h1>
      </header>
      <Profile title={"Gospel Football Tournament 2024"} />
    </div>
  );
}

export default Page;
